import{_ as d,a as r,b as o,c as l}from"./chunks/debug_swd_port_gnd_vcc3_3.B5pBAYX7.js";import{_ as i,c as s,j as e,a as n,G as h,a8 as c,B as u,o as p}from"./chunks/framework.BDnHobkS.js";const R=JSON.parse('{"title":"Holybro Kakute F7 (Знято з виробництва)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/kakutef7.md","filePath":"uk/flight_controller/kakutef7.md"}'),f={name:"uk/flight_controller/kakutef7.md"};function b(m,t,k,g,S,_){const a=u("Badge");return p(),s("div",null,[t[0]||(t[0]=e("h1",{id:"holybro-kakute-f7-знято-з-виробництва",tabindex:"-1"},[n("Holybro Kakute F7 (Знято з виробництва) "),e("a",{class:"header-anchor",href:"#holybro-kakute-f7-знято-з-виробництва","aria-label":'Permalink to "Holybro Kakute F7 (Знято з виробництва)"'},"​")],-1)),h(a,{type:"info",text:"Discontinued"}),t[1]||(t[1]=c('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>The <em>Kakute F7</em> from Holybro is a flight controller board designed for racers.</p><img src="'+d+'" width="400px" title="Kakute F7"><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="основні-характеристики" tabindex="-1">Основні характеристики <a class="header-anchor" href="#основні-характеристики" aria-label="Permalink to &quot;Основні характеристики&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="https://www.st.com/en/microcontrollers-microprocessors/stm32f745vg.html" target="_blank" rel="noreferrer">STM32F745VGT6</a><ul><li>ЦП: 216 МГц ARM Cortex M7 з одноточністю FPU</li><li>RAM: 320 KB SRAM</li><li>FLASH: 1 МБ</li></ul></li><li>Стандартна форма гонщика: 36x36 мм зі стандартним отвором 30,5 мм</li><li>ICM20689 Accel / Gyro (М&#39;які кріплення)</li><li>BMP280 Baro</li><li>microSD (логування)</li><li>6 UARTs</li><li>1 шина I2C</li><li>6 PWM виводів</li><li>Вбудований чіп OSD (AB7456 через SPI)</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p>Плату можна придбати в одному з наступних магазинів (наприклад):</p><ul><li><a href="https://www.getfpv.com/holybro-kakute-f7-tekko32-f3-metal-65a-4-in-1-esc-combo.html" target="_blank" rel="noreferrer">getfpv</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <em>Kakute F7</em> is designed to work with the <em>Tekko32</em> 4-in-1 ESC and they can be bought in combination.</p></div><h2 id="конектори-та-контакти" tabindex="-1">Конектори та контакти <a class="header-anchor" href="#конектори-та-контакти" aria-label="Permalink to &quot;Конектори та контакти&quot;">​</a></h2><p>This is the silkscreen for the <em>Kakute F7</em>, showing the top of the board:</p><p><img src="'+r+'" alt="Kakute F7 Silkscreen"></p><table tabindex="0"><thead><tr><th>Pin</th><th>Функція</th><th>PX4 default</th></tr></thead><tbody><tr><td>B+</td><td>Позитивна напруга батареї (2S-6S)</td><td></td></tr><tr><td>5V</td><td>Вихід 5В (максимум 2A)</td><td></td></tr><tr><td>VO</td><td>Відеовихід на відеопередавач</td><td></td></tr><tr><td>VI</td><td>Відеовхід з камери FPV</td><td></td></tr><tr><td>G або GND</td><td>Ground</td><td></td></tr><tr><td>SDA, SCL</td><td>Підключення I2C (для периферійних пристроїв)</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX та TX</td><td>TELEM1</td></tr><tr><td>R2, T2</td><td>UART2 RX та TX</td><td>TELEM2</td></tr><tr><td>R3, T3</td><td>UART2 RX та TX</td><td>Консоль відлагодження NuttX</td></tr><tr><td>R4, T4</td><td>UART4 RX та TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX та TX</td><td>RC порт</td></tr><tr><td>R7, T7</td><td>UART7 RX та TX (RX знаходиться у роз&#39;ємі для використання з 4-в-1 ESC)</td><td>Телеметрія DShot</td></tr><tr><td>LED</td><td>Дріт сигнальний для адресованих світлодіодів WS2182 (не тестувався)</td><td></td></tr><tr><td>Buz-</td><td>Негативна нога п&#39;єзожучка (Підключіть позитивну ногу динаміку до контакту 5В)</td><td></td></tr><tr><td>3V3</td><td>3.3V вивід (200 мA max)</td><td></td></tr><tr><td>M1 до M4</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-в-1 ESC)</td><td></td></tr><tr><td>М5, М6</td><td>Додаткові виходи сигналу двигуна (розташовані на боці плати)</td><td></td></tr><tr><td>RSI</td><td>Аналоговий вхід RSSI (0-3,3 В) від приймача</td><td></td></tr><tr><td>Завантаження</td><td>Кнопка завантажувача</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="оновлення-завантажувача-px4" tabindex="-1">Оновлення завантажувача PX4 <a class="header-anchor" href="#оновлення-завантажувача-px4" aria-label="Permalink to &quot;Оновлення завантажувача PX4&quot;">​</a></h2><p>The board comes pre-installed with <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Before PX4 firmware can be installed, the <em>PX4 bootloader</em> must be flashed. Download the <a href="https://github.com/PX4/PX4-user_guide/raw/main/assets/flight_controller/kakutef7/kakutef7_bl_0b3fbe2da0.hex" target="_blank" rel="noreferrer">kakutef7_bl.hex</a> bootloader binary and read <a href="./../advanced_config/bootloader_update_from_betaflight.html">this page</a> for flashing instructions.</p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakutef7_default</span></span></code></pre></div><h2 id="встановлення-прошивки-px4" tabindex="-1">Встановлення прошивки PX4 <a class="header-anchor" href="#встановлення-прошивки-px4" aria-label="Permalink to &quot;Встановлення прошивки PX4&quot;">​</a></h2><p>Прошивку можна встановити будь-якими звичайними способами:</p><ul><li>Збудуйте та завантажте джерело<div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_kakutef7_default upload</span></span></code></pre></div></li><li><a href="./../config/firmware.html">Load the firmware</a> using <em>QGroundControl</em>. Ви можете використовувати або готове вбудоване програмне забезпечення, або власне користувацьке програмне забезпечення.</li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>If you use a 4-in-1 ESC with Betaflight/Cleanflight motor assignment you can use the <a href="./../config/actuators.html">Actuator</a> configuration UI to set the motor ordering appropriately.</p><p>In addition to the <a href="./../config/">basic configuration</a>, the following parameters are important:</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Налаштування</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>Це має бути вимкнено, оскільки у платі немає внутрішнього магніту. Ви можете активувати це, якщо приєднаєте зовнішній магніт.</td></tr></tbody></table><h2 id="налаштування-послідовного-порту" tabindex="-1">Налаштування послідовного порту <a class="header-anchor" href="#налаштування-послідовного-порту" aria-label="Permalink to &quot;Налаштування послідовного порту&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM2</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Debug Console</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Телеметрія ESC (DShot)</td></tr></tbody></table><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><h3 id="системна-консоль" tabindex="-1">Системна консоль <a class="header-anchor" href="#системна-консоль" aria-label="Permalink to &quot;Системна консоль&quot;">​</a></h3><p>UART3 RX and TX are configured for use as the <a href="./../debug/system_console.html">System Console</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD interface</a> (JTAG) pins are:</p><ul><li><code>SWCLK</code>: Test Point 2 (Pin 72 on the CPU)</li><li><code>SWDIO</code>: Test Point 3 (Pin 76 on CPU)</li><li><code>GND</code>: As marked on board</li><li><code>VDD_3V3</code>: As marked on board</li></ul><p>Ці показані нижче.</p><p><img src="'+o+'" alt="SWD Pins on Kakute F7 - CLK SWO"> <img src="'+l+'" alt="SWD Pins on Kakute F7:  GND and VDD3V3"></p>',37))])}const y=i(f,[["render",b]]);export{R as __pageData,y as default};
